import { useState } from 'react';
import './Chat2.css';

function Chat2(){

    return(
        <div>
            <input type="button" value="+" onClick={increment}/>
            <input type="button" value="-" onClick={decrement}/>
            <input type="button" value="Reset" onClick={reset}/>
            { count }
        </div>
    )
}

export default Chat2;
